import { Link } from "react-router-dom"

const ClientTag = (props) => {

    const {_id, name, commissioner, client} = props

    return (
        <div>
            <Link to={{
                pathname: '/client',
                state: {
                    client: client
                }
            }}>
            <h2>{name}</h2>
            <h3>{_id}</h3>
            <h3>{!commissioner ? "No Commissioner Assigned" : {commissioner}}</h3>
            </Link>
        </div>
    )
}

export default ClientTag
